from pyspark.sql.types import StringType

from pyspark.sql.functions import udf

print(testParam)

@udf(StringType())

 

def set_status(value, target_value, target_area):

 

    if any([v is None for v in [value, target_value, target_area]]):

        status = "rot"

    else:

        if target_value > target_area:

            if value >= target_value:

                status = "grün"

            elif (value < target_value) and (value > target_area):

                status = "gelb"

            else:

                status = "rot"

        else:

            if value <= target_value:

                status = "grün"

            elif (value > target_value) and (value < target_area):

                status = "gelb"

            else:

                status = "rot"

    return status

 

# definition of a sample DataFrame

df = spark.createDataFrame([(1, 5, 3)], ('value', 'target_value', 'target_area'))

 

# test use of a UDF

df.withColumn('status', set_status('value', 'target_value', 'target_area')).show()

print(testParam)
